import React from "react";

class Navbar extends React.Component{
    render(){
        return(
            <nav>
                <div className="main-wrapper">        
                    <span className="logo">
                        NewsBix
                    </span>
                    <span className="searchbar">
                        Searchbar
                    </span>
                    <span className="signup">
                        SignUp
                    </span>
                </div>
            </nav>
        );
    }
}

export default Navbar;
